import React from 'react';
import { Box, Container, TextField, Button, Typography, Paper } from '@mui/material';

function Login() {
  return (
    <Container maxWidth="sm" sx={{ 
      minHeight: '100vh',
      display: 'flex',
      alignItems: 'center',
      py: 4 
    }}>
      <Paper elevation={3} sx={{ width: '100%', p: 4 }}>
        <Box sx={{ 
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center'
        }}>
          <Typography variant="h4" sx={{ mb: 4, fontWeight: 'bold' }}>
            Admin Login
          </Typography>
          <Box component="form" sx={{ width: '100%' }}>
            <TextField
              margin="normal"
              required
              fullWidth
              label="Username"
              autoFocus
              sx={{ mb: 2 }}
            />
            <TextField
              margin="normal"
              required
              fullWidth
              label="Password"
              type="password"
              sx={{ mb: 3 }}
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{
                py: 1.5,
                backgroundColor: '#1976d2',
                '&:hover': {
                  backgroundColor: '#1565c0'
                }
              }}
            >
              LOGIN
            </Button>
          </Box>
        </Box>
      </Paper>
    </Container>
  );
}

export default Login;
